(()=>{const t=document.querySelectorAll('[data-el="bic-c-button-toggle-cta"]');function e(e){e.preventDefault(),function(t){t.forEach((t=>{t.classList.remove("active")}))}(t);const{target:c}=e,{value:a}=c.dataset;c.classList.add("active");const n=new CustomEvent("buttonsToggle:selected",{detail:{button:c,value:a}});document.dispatchEvent(n)}t.forEach((t=>{t.addEventListener("click",e)}))})();